namespace Pandora.Infrastructure.Identity.Services
{
    using Pandora.Infrastructure.Identity.DAL.Context;
    using Pandora.Infrastructure.Identity.Interfaces;
    using Pandora.Infrastructure.Identity.Model.Dtos;
    using Pandora.Infrastructure.Identity.Model.Entities;
    using Microsoft.AspNetCore.Mvc;
    using Microsoft.EntityFrameworkCore;
    using Microsoft.Extensions.Logging;
    using System.Buffers.Text;
    using System.Collections.Generic;
    using System.Linq;
    using System.Text;
    using System.Threading.Tasks;

    public class UserService : BaseService, IUserService
    {
        public UserService(IContextProvider contextProvider, ILoggerFactory loggerFactory,
            IdentityDBContext context) : base(contextProvider, loggerFactory, context)
        {

        }

        public async Task<bool> Delete(int id)
        {
            _context.Users.Find(id).Delete();
            return await _context.SaveChangesAsync() > 0;
        }

        public async Task<bool> Update(UserDTO dto)
        {
            var user = _context.Users.AsTracking().FirstOrDefault(x => x.Id == dto.Id);
            //settings?.Update(dto.ThemeName);
            return await _context.SaveChangesAsync() > 0;
        }

        public async Task<byte[]> GetUserPhoto(string userId)
        {
            var photoBase64 = "data:image/jpeg;base64,";
            var encoded = Encoding.UTF8.GetBytes(photoBase64);
            return await Task.FromResult(encoded);
        }

        public async Task<UserDTO> GetById(string id, bool includeDeleted = false)
        {
            var user = await _context.Users.Include(x => x.Settings).AsTracking().FirstOrDefaultAsync(x => x.Id == id.ToString());
            return user.ConvertToDto();
        }

        public async Task<UserDTO> GetByLogin(string login, bool includeDeleted = false)
        {
            //var user = await userRepository.GetByLogin(login, _session, includeDeleted);
            return await Task.FromResult<UserDTO>(null); //user.MapTo<UserDTO>();
        }

        public async Task<List<UserDTO>> GetAll(bool includeDeleted = false)
        {
            return await _context.Users.Include(x => x.Settings).AsTracking().Select(u => u.ConvertToDto()).ToListAsync();
        }
    }
}